import { defineComponent, ref } from "vue";
import child from "./components/child.vue";
export default defineComponent({
  name: "name",
  components: {
    child,
  },
  setup() {
    console.log("THIS", this);
    let msg = ref("2222");
    const xx = (val: string) => {
      msg.value += val;
    };
    return { msg, xx };
  },
});
